// react
import React from 'react';

// third-party
import { Link } from 'react-router-dom';
import { NavLink } from 'react-router-dom';

function NavigationLinks() {
    const links = [
        { title: "General search", url: '/pages/search' },
        { title: "Sent/Received documents search", url: '/pages/orders' },
        { title: "Setings", url: '/pages/options' }
    ];

    const linksList = links.map((item, index) => (
        <div key={index} className="">
            <Link className="text" to={item.url}>{item.title}</Link>
        </div>
    ));

    return (
        <div>
<ul className="nav-links__list">
            <li className="nav-links__item">
                <NavLink to="/pages/search" exact activeClassName="selected">
                    <span>General search</span>
                </NavLink>
            </li>
            <li className="nav-links__item">
                <NavLink to="/pages/orders" exact activeClassName="selected">
                    <span>Sent/Received documents search</span>
                </NavLink>
            </li>
            <li className="nav-links__item">
                <NavLink to="/pages/options" exact activeClassName="selected">
                    <span>Setings</span>
                </NavLink>
            </li>
            </ul>
            {linksList}
        </div>

    );
}

export default NavigationLinks;
